pub enum RemoteProcedure<T: Metadata> {

    /// A method call
    Method(Arc<RpcMethod<T>>),

    /// A notification
    Notification(Arc<RpcNotification<T>>),

    /// An alias to other method,
    Alias(String),
}

pub enum Compatibility {

    /// Compatible only with JSON-RPC 1.x
    V1,

    /// Compatible only with JSON-RPC 2.0
    V2,

    /// Compatible with both
    Both,
}

pub enum ErrorCode {

    /// Invalid JSON was received by the server.
    /// An error occurred on the server while parsing the JSON text.
    ParseError,

    /// The JSON sent is not a valid Request object.
    InvalidRequest,

    /// The method does not exist / is not available.
    MethodNotFound,

    /// Invalid method parameter(s).
    InvalidParams,

    /// Internal JSON-RPC error.
    InternalError,

    /// Reserved for implementation-defined server-errors.
    ServerError(i64),
}

pub enum Id {

    /// No id (notification)
    Null,

    /// Numeric id
    Num(u64),

    /// String id
    Str(String),
}

pub enum Params {

    /// No parameters
    None,

    /// Array of values
    Array(Vec<Value>),

    /// Map of values
    Map(serde_json::Map<String, Value>),
}

pub enum Call {

    /// Call method
    MethodCall(MethodCall),

    /// Fire notification
    Notification(Notification),

    /// Invalid call
    Invalid {
        /// Call id (if known)
        #[serde(default = "default_id")]
        id: Id,
    },
}

pub enum Request {

    /// Single request (call)
    Single(Call),

    /// Batch of requests (calls)
    Batch(Vec<Call>),
}

pub enum Output {

    /// Success
    Success(Success),

    /// Failure
    Failure(Failure),
}

pub enum Response {

    /// Single response
    Single(Output),

    /// Response to batch request (batch of responses)
    Batch(Vec<Output>),
}
